const CustomerService = () => {
    return ( 
        <div className="contact-section vh-100 d-flex justify-content-center align-items-center">
            <div className="contact-us"></div>

            <div className="reference">
                <ul>
                    <li>Telefono</li>
                    <li>Email</li>
                    <li>Instagram</li>
                    <li>Facebook</li>
                    <li>TikTok</li>
                </ul>
            </div>
        </div>
     );
}
 
export default CustomerService;
